import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div class = "upper">
        <div class = "Text">
          <h2 class = "name">IMPULSIVE KOALA</h2><br/>
          <h1 class = "heading">UX Researcher passionate about <span class = "btext"><i>solving problems</i></span> by understanding interfaces and<br/>examining how <span class = "btext"><i>people interact with them</i></span>.</h1>
        </div>
      </div>
      <div class = "grid">
        <div class = "tile">
          <div class = "txt">
            Pivo Technologies
          </div>
          <div class = "image">
            <img src = "c1.jpg"></img>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
